  false,\n\t\"url\": null,\n\t\"notes\": \"The Palos Verdes shelf near Los Angeles
  is contaminated with DDT and PCBs discharged through the White Point ocean outfalls,
  mostly prior to 1971. The U. S. Environmental Protection Agency (EPA) initiated
  Superfund remediation activities, including a Remedial Investigation and Feasibility
  Study (RI/FS). As part of the RI/FS, the U.S. Geological Survey (USGS), with assistance
  from the Los Angeles County Sanitation Districts (LACSD), conducted an oceanographic
  measurement program on the Palos Verdes shelf from December 2007 to April 2008.
  The objectives of the program were to measure currents, temperature, and salinity
  throughout the water column at high sampling rates; measure near-bottom current
  speeds, wave-orbital motions, and suspended-sediment concentrations; and use the
  data collected to determine the quantity and direction of sediment erosion and transport
  on the shelf. This page provides links to the data obtained during the winter 2007
